svg.script:
function dgid(id) {return document.getElementById(id)}
function ga(it, id) {return it.getAttribute(id)}
function sa(it, id, to) {return it.setAttribute(id, to)}
function hello() {
	if (ga(dgid("Layer_1"), "class") == "Foo") {
	sa(dgid("Layer_1"), "class", "nil")
	}
	else {
	sa(dgid("Layer_1"), "class", "Foo")}
}
